import ReactGoogleSheets from 'react-google-sheets';

 
class DataComponent extends Component {
  constructor(props) {
    super(props)
    this.state = {
      sheetLoaded: false,
    }
  }
  render() {
    return (
      <ReactGoogleSheets 
        clientId={165199781763-uilq6f58re435629s1upckbam6vd0b84.apps.googleusercontent.com}
        apiKey={AIzaSyDByF2d1yMDc-p0ar3vz2l4P6qkVf5oFSY}
        spreadsheetId={CAE4yrtN696oLRNVxhBlIYiX9rdzgRz7PAEgGPjKw_I}
        afterLoading={() => this.setState({sheetLoaded: true})}
      >
        {this.state.sheetLoaded ? 
          <div>
            {/* Access Data */}
            {console.log('Your sheet data : ', this.props.getSheetsData({RossScoutingTest}))}
            {/* Update Data */}
            <button onClick={() => {
              this.props.updateCell(
                'sheet02', // sheetName
                'E', // column
                13, // row
                'Apple', // value
                null, // successCallback
                (error) => {
                  console.log('error', error)
                } // errorCallback
              );
            }}>update cell!</button>
          </div>
          :
          'loading...'
        }
      </ReactGoogleSheets>
    )
  }
}
 
export default ReactGoogleSheets.connect(DataComponent);
